import React from "react";
import "./wyniki.css";
import NewForm from "./Form";
import Card from "../UI/Card";

function Wyniki(props) {

    console.log(props.Imie);
    console.log(props.Imie);
  return (
    <li>
      <div>
        <Card>
          <NewForm onSaveDate={Wyniki} />
        </Card>
        <div>
          <Card>
          <h2>{props.Imie}</h2>
          <h2>{props.Wiek}</h2>
          </Card>
        </div>
      </div>
    </li>
  );
}

export default Wyniki;
